MathJax.Localization.addTranslation("br","HelpDialog",{version:"2.7.9",isLoaded:!0,strings:{Help:"Sikour MathJax",MathJax:"*MathJax* zo ul levraoueg JavaSkript. Ganta\xF1 e c'hall aozerien ar pajenno\xF9 enderc'hel jedado\xF9 en o fajenno\xF9 Web. Evel lenner n'ho po ket ezhomm d'ober netra evit ma'z aio en-dro.",Browsers:`"Merdeerien": Mont a ra Mathjax en-dro gant an holl verdeerien modern, en ur gonta\xF1 Explorer 6, Firefox 3, Chrome 0.2, Safari 2, Opera 9.6 hag o stummo\xF9 kre\xF1voc'h, hag ivez an darn vrasa\xF1 eus ar merdeerio\xF9 evit hezougello\xF9 ha tablezenno\xF9.`,Menu:`"La\xF1ser Math" : Ouzhpenna\xF1 a ra MathJax ul la\xF1ser kemperzhel  d'ar c'hevatalenno\xF9. Klikit war bouton deho\xF9 al logodenn pe klikit war war ne vern peseurt formulenn jedoniezh o terc'hel da boueza\xF1 war Ktrl evit monet d'al la\xF1ser.`,ShowMath:`Gant "Diskwel ar matematiko\xF9 evel" e c'hallot diskwel balizenna\xF1 tarzh ar jedad evit eila\xF1-pega\xF1 (evel MathML pe en e furmad orin).`,Settings:`Gant *Arventenno\xF9" e c'hallit kontrolla\xF1 arc'hwelio\xF9 MathJax, evel ment ar jedado\xF9, hag ar gwikefre implijet evit diskwel ar c'hevatalenno\xF9.`,Language:`"Yezh" a lez ac'hanoc'h da zibab ar yezh implijet gant MathJax evit e la\xF1serio\xF9 hag e gemennadurio\xF9.`,Zoom:"*Math zoom*: M'eo diaes deoc'h lenn ur gevatalenn e c'hall MathJax brasaat anezhi evit skoazella\xF1 ac'hanoc'h da welet anezhi gwelloc'h.",Accessibilty:"*Monedusted*:Mathjad a labouro ent emgefreek gant lennerio\xF9 skramm evit ma vo aesoc'h d'an dud fall o gweled pledi\xF1 gant ar jedoniezh.",Fonts:`"Fonto\xF9*: gant Mathjax e vo implijet ar fonto\xF9 jedoniel zo ma vezont staliet en hoc'h urzhiataer ; anez e vo implijet ar fonto\xF9 kavet war ar Web. Daoust ma n'eo ret, gant ar fonto\xF9 staliet ent lec'hel e vo buanaet ar c'henaozadur. Alia\xF1 a reomp ac'hanoc'h da stalia\xF1 ar [fonto\xF9 STIX](%1).`,CloseDialog:"Serri\xF1 ar voest kendivizout skoazell"}}),MathJax.Ajax.loadComplete("[MathJax]/localization/br/HelpDialog.js");
